import React from 'react'

export const ME_QUERY = gql`
    query me {
        me {
            id
            Profile {
                id
                bio
                location
                website
                avatar
            }
        }
    }
`
;

function Profile() {
  return (
    <div>
        <h1>Profile</h1>
    </div>
  )
}

export default Profile;
